description:
Tom (Steven Macintosch) ar en medelklass stadsbo vars liv har natt en
slutpunkt. D (Ashley Walters) ar en ung crackberoende grabb smart och
desperat. Tom ar helt borta nar han finner sig sjalv i D:s rullande varuhus
i fard med att gora en affar med D. De tva borjar ett irrationellt dodligt
spel av katt och ratta leken...
